import * as React from 'react';

export const PeopleHost = () => {
  return (
    <div className='bg-red-300 w-full max-w-5xl mx-auto flex justify-center'>
      <div className='bg-red-100 py-16 flex flex-col items-center'>
        <div className='w-80p'>
          <h3
            style={{ fontFamily: 'airbnb-bold' }}
            className='text-3xl text-gray-750 text-center'>
            Over 2 million people host on Airbnb and no host's style is the
            same.
          </h3>
        </div>
        <div>
          <a href=''>Learn what's expected of hosts</a>
        </div>
      </div>
    </div>
  );
};
